	Person: class{
		constructor(){
			this.gender = minjune.genderSeed[Math.round(Math.random()*(minjune.genderSeed.length-1))];
			this.head = minjune.headSeed[Math.round(Math.random()*(minjune.headSeed.length-1))];
			this.body = minjune.bodySeed[this.gender][Math.round(Math.random()*(minjune.bodySeed[this.gender].length-1))];
			this.name = this.head + this.body;
			if(minjune.headRoman[this.head]){
				this.romanName = minjune.headRoman[this.head] + " ";
			}else{
				this.romanName = minjune.romanize(this.head) + " ";
			}
			this.romanName += minjune.romanize(this.body);
			this.initial = this.romanName.split(" ")[0][0];
			for(var i in this.body){
				this.initial += minjune.romanize(this.body[i])[0];
			}
		}
	},
	romanize: function(hangul){
		var dict = {
			초: {
				key:"ㄱㄴㄷㄹㅁㅂㅅㅇㅈㅊㅋㅌㅍㅎㄲㄸㅃㅆㅉ",
				out:"g,n,d,r,m,b,s,,j,ch,k,t,p,h,kk,tt,pp,ss,jj".split(",")
			},
			중종: {
				key:"ㄱㄴㄷㄹㅁㅂㅅㅇㅈㅊㅋㅌㅍㅎㄲㄸㅃㅆㅉㅏㅑㅓㅕㅗㅛㅜㅠㅡㅣㅐㅒㅔㅖㅚㅟㅘㅙㅝㅞㅢ",
				out:"k,n,t,l,m,p,s,ng,j,ch,k,t,p,h,kk,tt,pp,ss,jj,a,ya,eo,yeo,o,yo,u,yu,eu,i,ae,yae,e,ye,oe,wi,wa,wae,wo,we,ui".split(",")
			},
			모음: "ㅏㅑㅓㅕㅗㅛㅜㅠㅡㅣㅐㅒㅔㅖㅚㅟㅘㅙㅝㅞㅢ",
			이중모음: {
				ㅗㅣ: "ㅚ",
				ㅜㅣ: "ㅟ",
				ㅗㅏ: "ㅘ",
				ㅗㅐ: "ㅙ",
				ㅜㅓ: "ㅝ",
				ㅜㅔ: "ㅞ",
				ㅡㅣ: "ㅢ"
			}
		}
		var output = "";
		var spl = Hangul.d(hangul, true)
		for(var i in spl){
			for(var j in spl[i]){
				if(dict.모음.indexOf(spl[i][j-1]) !== -1 && dict.모음.indexOf(spl[i][j]) !== -1){
					spl[i][j-1] = dict.이중모음[spl[i][j-1]+spl[i][j]];
					spl[i].splice(j, 1);
				}
			}
		}
		for(var i in spl){
			for(var j in spl[i]){
				if(j == 0){
					output += dict.초.out[dict.초.key.indexOf(spl[i][j])];
				}else{
					output += dict.중종.out[dict.중종.key.indexOf(spl[i][j])];
				}
			}
		}
		return output;
	}
